import { LabelInput } from "../../components/input";
import DateNavigation from "./date-navigation";
import Exercises from "./exercises";

const TodayWorkout = () => {
    return (<>
        <LabelInput text="Repeticiones" type="number"/>
        <DateNavigation/>
        <Exercises/>
    </>);
}

export default TodayWorkout;
